:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  JWILLIAMS, Gerald Standish and ROLLESTON, Rachel Fane
  JWILLIAMS, William Rolleston Standish (Bill) and DAVEY, Jillian Myrtle
  03> WILLIAMS, Benjamin Gerald
  b 20.12.1977
  Benjamin b. at Auckland. He was educated at Westlake Boys' High School and is now
  completing a Certificate in Graphic Pre-Press at Auckland Institute of Technology,
  with a view to a career in desktop publishing.
  02> WILLIAMS, Anna Mary
  b 23.10.1949
  Anna b. at Hastings. Address: 99 Grafton Road, Roseneath, Wellington.
  Anna gained a BA Degree in 1971 and a Diploma in Social Work in 1982, both from Victoria
  University, and gained a Certificate of Hand Loom Weaving from Nelson Polytechnic in
  1977. She works as an Oriental Rug Repairer and Restorer.
  01> WILLIAMS, Alden Norman
  b 27.05.1986
  Alden b. at Wellington.
  03> WILLIAMS, Louise Rachel m on 10.05.1975 to PEMBERTON, Douglas Gregory
  b 30.04.1951
  b 28.02.1948
  Louise b, at Hastings. Gregory, s/o Ernest Louis Bain Pemberton and Elsie
  Millicent Cribb, b, at Timaru. Address: 10 Douglas Street, Whakatane.
  Louise graduated BA from Canterbury University in 1972. She worked as a
  medical social worker and gained a Certificate in Social Work in the same
  year. After gaining her Diploma in Teaching in 1975, she taught in Nelson for
  two years.
  Greg graduated MagEng from Canterbury University in 1975 and he and Louise lived in Barbados from 1977
  until 1980. Greg worked as an agricultural engineering consultant with the Caribbean Development Bank
  and Louise taught both primary and secondary students, as well as English to foreign students. In 1981
  Greg, Louise and her father, Gerald, sailed their nine-metre yacht from Barbados, through the Panama
  Canal, to Auckland. They settled in Whakatane in 1984. Louise is job sharing a primary teaching
  position and Greg is a director with Environment Bay of Plenty.
  01> PEMBERTON, Matthew Gerald
  b 02.03.1983
  Matthew b. at Nelson.
